BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "deck_names" (
	"deck_name"	TEXT NOT NULL UNIQUE,
	"deck_id"	INTEGER NOT NULL UNIQUE,
	PRIMARY KEY("deck_id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "game_data" (
	"id"	INTEGER NOT NULL UNIQUE,
	"game_id"	INTEGER,
	"game_type"	TEXT,
	"date"	TEXT,
	"player_name"	TEXT,
	"deck_name"	TEXT,
	"start"	INTEGER,
	"win"	INTEGER,
	"win_turn"	INTEGER,
	"win_type"	TEXT,
	"mv_card"	TEXT,
	"life"	INTEGER,
	"time_total"	NUMERIC,
	"deck_link"	TEXT,
	"uploader"	TEXT,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "player_names" (
	"player_name"	TEXT NOT NULL UNIQUE,
	"player_id"	INTEGER NOT NULL UNIQUE,
	PRIMARY KEY("player_id" AUTOINCREMENT)
);
COMMIT;
